import logo from './imagenes/borrador-logo.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="flex flex-wrap bg-emerald-100 h-24 justify-between items-center shadow-md">
        <div className="flex items-center px-8">
          <img className="h-16 flex" src={logo} alt="" />
          <h2 className="justify-center px-2">CMP</h2>
        </div>
        <nav>
          <a href="register.html" className="px-8 hover:text-indigo-700 text-xl text-white">Crear Cuenta</a>
        </nav>
      </header>
    </div>



  );
}

export default App;
